import React, { useState } from 'react';
import "./table.css"

const Table = ({ data }) => {
    const [searchTerm, setSearchTerm] = useState('');

    const handleSearch = (event) => {
        setSearchTerm(event.target.value);
    };

    const filteredData = data.filter((item) =>
        item.attackerIP.includes(searchTerm)
    );

    return (
        <div>
            <p>
            <input type="text" value={searchTerm} id="attackerIP" onChange={handleSearch} placeholder="Search by Attacker IP" />
                <input type="text" value={searchTerm} id="attackerIP" onChange={handleSearch} placeholder="Search by Attacker IP" />
            </p>
            <br/>
            <table>
                <thead>
                <tr>
                    <th>Report ID</th>
                    <th>Service Name</th>
                    <th>Date</th>
                    <th>Company</th>
                    <th>Attacker IP</th>
                    <th>Trap Name</th>
                    <th>Session INFO</th>
                </tr>
                </thead>
                <tbody>
                {filteredData.map((item) => (
                    <tr key={item.reportID}>
                        <td>{item.reportID}</td>
                        <td>{item.serviceName}</td>
                        <td>{item.date}</td>
                        <td>{item.company}</td>
                        <td>{item.attackerIP}</td>
                        <td>{item.trapName}</td>
                        <td>{item.sessionINFO}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default Table;
